pragma solidity ^0.4.17;

contract Product {

	address private owner;
	uint pId;
	bytes32 pName;
	uint   quantity;
	string description;
	string image;
	uint price;
	enum product_States {available, unavailable}

	function Product() public {

	}

	function setId(uint _id) public {
		pId = _id;
	}

	function getId() view public returns (uint){
		return pId;
	}

	function setName(bytes32 _pName) public {
		pName = _pName;
	}

	function getName() view public returns (bytes32) {
		return pName;
	}

	function setQty(uint _quantity) public {
		quantity = _quantity;
	}

	function getQty() view public returns (uint) {
		return quantity;
	}

	function setDescription(string _description) public {
		description = _description;
	}

	function getDescription() view public returns (string) {
		return description;
	}

	function setImage(string _image) public {
		image = _image;
	}

	function getImage() view public returns (string) {
		return image;
	}

	function setPrice(uint _price) public {
		price = _price;
	}

	function getPrice() view public returns (uint) {
		return price;
	}


}
